import React, { useState } from 'react';

function PredictionForm() {
  const [formData, setFormData] = useState({
    gender: '',
    age: '',
    height: '',
    weight: '',
    family_history_with_overweight: '',
    FAVC: '',
    FCVC: '',
    NCP: '',
    CAEC: '',
    SMOKE: '',
    CH2O: '',
    FAF: '',
    TUE: '',
    CALC: '',
    MTRANS: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://127.0.0.1:5000/predict', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });
      const result = await response.json();
      console.log(result);
    } catch (error) {
      console.error('Error:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* Form fields here */}
      <input type="text" name="gender" onChange={handleChange} />
      <input type="number" name="age" onChange={handleChange} />
      <input type="number" name="height" onChange={handleChange} />
      <input type="number" name="weight" onChange={handleChange} />
      <input type="text" name="family_history_with_overweight" onChange={handleChange} />
      <input type="text" name="FAVC" onChange={handleChange} />
      <input type="text" name="FCVC" onChange={handleChange} />
      <input type="text" name="NCP" onChange={handleChange} />
      <input type="text" name="CAEC" onChange={handleChange} />
      <input type="text" name="SMOKE" onChange={handleChange} />
      <input type="text" name="CH2O" onChange={handleChange} />
      <input type="text" name="FAF" onChange={handleChange} />
      <input type="text" name="TUE" onChange={handleChange} />
      <input type="text" name="CALC" onChange={handleChange} />
      <input type="text" name="MTRANS" onChange={handleChange} />
      <button type="submit">Predict</button>
    </form>
  );
}

export default PredictionForm;
